-- ==============================
-- Actualizar Saldos (aplicar transacciones)
-- ==============================

UPDATE Cuenta
SET Saldo = ISNULL(orig.Saldo,0) + ISNULL(dep.sumDeposits,0) - ISNULL(wit.sumWithdraws,0)
FROM Cuenta
LEFT JOIN (SELECT IdCuenta AS CId, Saldo FROM Cuenta) orig ON orig.CId = Cuenta.IdCuenta
LEFT JOIN (
    SELECT FkCuentaDeposito AS CId, SUM(ValorTransaccion) AS sumDeposits
    FROM Transaccion
    WHERE FkCuentaDeposito IS NOT NULL
    GROUP BY FkCuentaDeposito
) dep ON dep.CId = Cuenta.IdCuenta
LEFT JOIN (
    SELECT FkCuentaRetiro AS CId, SUM(ValorTransaccion) AS sumWithdraws
    FROM Transaccion
    WHERE FkCuentaRetiro IS NOT NULL
    GROUP BY FkCuentaRetiro
) wit ON wit.CId = Cuenta.IdCuenta;

